<html lang="en">

<head>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no"/>

    <title>PPDE - Uncertainty Visualization via Low-Dimensional Posterior Projections</title>

    <!--<meta http-equiv="refresh" content="30" />-->
    <script src="https://cdnjs.cloudflare.com/ajax/libs/plotly.js/2.27.1/plotly.min.js" integrity="sha512-R4Vz0/42Zw4rKUc8nc8TuKQGMtOMzCHxtXIFQoCB/fOT3q+L8f5l2s8n3CZsbJveMhoAV9yP8yWdj8vzwQx0hA==" crossorigin="anonymous" referrerpolicy="no-referrer"></script>

    <style>
      .page {max-width: 1400px; padding-right:15px; padding-left: 15px; margin: auto;}
      h1 {text-align: center;}
      a {color: #007bff; text-decoration: none;}
      .centered {text-align: center;}

      .viewer {display: block; width: 700px; margin: 0 auto;}
      .viewer .inputs-area {
        display: grid;
        grid-template-columns: repeat(auto-fit, minmax(10px, 1fr));
        grid-column-gap: 20px;
      }
      .viewer .interactive-area {
        margin-top: 20px;
        display: grid;
        grid-template-columns: repeat(auto-fit, minmax(10px, 1fr));
        grid-column-gap: 20px;
      }
      .viewer .instructions-area {margin-top: 20px; font-size: 1.5rem; font-weight: 800; color: brown;}
      .viewer .image-title {font-size: 1.25rem; font-weight: 600;}
      .viewer .img-box img {display: block; margin: 0 auto; max-width: 100%}
      .viewer .back-proj-area .img-box {height: 100%}
      .viewer img {image-rendering: pixelated;}
      .viewer .debug-area {display: none;}
      .viewer .debug-area > div {display: inline-block;}

      .samples-selector {display: block; width: 1200px; margin: 0 auto;}
      .samples-grid {
        display: grid;
        grid-template-columns: repeat(auto-fit, 128px);
        grid-column-gap: 20px;
        grid-row-gap: 20px;
        height: 250px;
        overflow-y: scroll;
      }
      .samples-area .img-box img {width:100%; image-rendering: pixelated; cursor: pointer;}
    </style>
</head>

    <script>
      function createChild(parent, tagName="div", classesList=[], innerHTML=null) {
        let el = document.createElement(tagName);
        if (parent != null){ parent.appendChild(el); }
        for (let i = 0; i < classesList.length; i++) { el.classList.add(classesList[i]); }
        if (innerHTML != null){ el.innerHTML = innerHTML; }
        return el
      }

      function createImgBox(parent) {
        let imgBox = createChild(parent, "div", ["img-box"]);
        let imgObj = createChild(imgBox, "img");
        return imgObj
      }

      function createTitledImage(parent, title) {
        let container = createChild(parent, "div", ["titled-img"]);
        createChild(container, "div", ["image-title", "centered"], title);
        let imgObj = createImgBox(container);
        return imgObj
      }

      function base64ToArrayBuffer(base64) {
          var binary_string =  window.atob(base64);
          var len = binary_string.length;
          var bytes = new Uint8Array( len );
          for (var i = 0; i < len; i++)        {
              bytes[i] = binary_string.charCodeAt(i);
          }
          return bytes.buffer;
      }

      async function setImgSrc(imgObj, pngData, timeout=5000) {
        return new Promise((resolve, reject) => {
          const timer = setTimeout(reject, timeout, false)
          imgObj.onload = () => {clearTimeout(timer); resolve(true)};
          imgObj.onerror = () => {clearTimeout(timer); reject(false)};
          imgObj.src = "data:image/png;base64, " + pngData;
        })
      }

      function img2Array(img, ctx){
        ctx.drawImage(img, 0, 0);
        return new Float32Array(ctx.getImageData(0, 0, img.naturalWidth, img.naturalHeight).data);
      }

      Viewer = class {
        constructor(parentEl, maxSize = 256, marginSize=10) {
          this.maxSize = maxSize;
          this.marginSize = marginSize;

          this.v1 = 0;
          this.v2 = 0;
          this.id = null;
          this.imgSize = null;
          // this.grayScale = null;

          this.center = null;
          this.dir1 = null;
          this.dir2 = null;

          // ## HTML elements
          // ## =============
          // ## Create main container
          this.topContainer = createChild(parentEl, "div", ["viewer"]);

          this.inputsContainer = createChild(this.topContainer, "div", ["inputs-area"]);
          this.interarctiveContainer = createChild(this.topContainer, "div", ["interactive-area"]);
          this.instructionsContainer = createChild(this.topContainer, "div", ["instructions-area"], "Select a point on the PPD to view the corsponding back-projection.");
          this.statusContainer = createChild(this.topContainer, "div", ["status-area"]);
          this.debugContainer = createChild(this.topContainer, "div", ["debug-area"]);

          // ## Create inputs
          this.originalImageObj = createTitledImage(this.debugContainer, "Original Image");
          this.distortedImageObj = createTitledImage(this.inputsContainer, "Distorted Image");
          this.restoredImageObj = createTitledImage(this.inputsContainer, "MMSE Estimator");
          this.restoredLowerImageObj = createTitledImage(this.debugContainer, "MMSE Est low");
          this.dir1ImageObj = createTitledImage(this.inputsContainer, "1st Direction");
          this.dirLower1ImageObj = createTitledImage(this.debugContainer, "1st Dir Low");
          this.dir2ImageObj = createTitledImage(this.inputsContainer, "2ed Direction");
          this.dirLower2ImageObj = createTitledImage(this.debugContainer, "2nd Dir Low");

          // ## PPD area
          this.distContainer = createChild(this.interarctiveContainer, "div", ["dist-area"]);
          createChild(this.distContainer, "div", ["image-title", "centered"], "PPD");
          this.distPlotly = createChild(this.distContainer, "div");

          // ## Set back projection image
          this.backProjContainer = createChild(this.interarctiveContainer, "div", ["back-proj-area"]);
          createChild(this.backProjContainer, "div", ["image-title", "centered"], "Back-projection");
          this.backProjImageObj = createImgBox(this.backProjContainer);

          // ## Set Temporary canvas
          this.tmpCanvas = createChild(this.debugContainer, "canvas");
          this.tmpContext = this.tmpCanvas.getContext("2d", { willReadFrequently: true });

          // ## Set PPD plot
          let traces = [{
            type: 'heatmap',
            colorscale: colorScale,
            showscale: false,
            name: "",
          }, {
            x: [this.v1],
            y: [this.v2],
            type: 'lines',
            name: "",
            hoverinfo: 'skip',
          }];
          for (let i = 0; i < 4; i++) {
            let color = ['#A1CCD1', '#6499E9', '#176B87', '#04364A'][i]
            traces.push({
              type: 'contour',
              autocontour: false,
              showscale: false,
              colorscale: [[0,color], [1,color]],
              line: {width: 2},
              hoverinfo: 'skip',
            });
          }
          let layout = {
            height: this.distPlotly.clientWidth,
            width: this.distPlotly.clientWidth,
            xaxis_range: [-6, 6],
            yaxis_range: [-6, 6],
            margin: {t: 0, b: 0, l: 0, r: 0},
            xaxis_showticklabels: false,
            yaxis_showticklabels: false,
            yaxis_scaleanchor: 'x',
            yaxis_scaleratio: 1,
          }
          Plotly.newPlot(this.distPlotly, traces, layout, {responsive: false, displayModeBar: false});

          let this_ = this
          this.distPlotly.on('plotly_click', function(data){
            this_.v1 = data.points[0].x;
            this_.v2 = data.points[0].y;
            this_.v1 = Math.round(this_.v1 * 100) / 100;
            this_.v2 = Math.round(this_.v2 * 100) / 100;
            this_.update_v();
          });
        };

        async setStatus(status){
          this.statusContainer.innerHTML = status;
        }

        async updateData(sampleData) {
          this.id = sampleData["index"];
          this.v1 = 0;
          this.v2 = 0;

          await Promise.all([
            setImgSrc(this.originalImageObj, sampleData["org"]),
            setImgSrc(this.distortedImageObj, sampleData["distorted"]),
            setImgSrc(this.restoredImageObj, sampleData["restored"]),
            setImgSrc(this.restoredLowerImageObj, sampleData["restored_lower"]),
            setImgSrc(this.dir1ImageObj, sampleData["dirs"][0]),
            setImgSrc(this.dirLower1ImageObj, sampleData["dirs_lower"][0]),
            setImgSrc(this.dir2ImageObj, sampleData["dirs"][1]),
            setImgSrc(this.dirLower2ImageObj, sampleData["dirs_lower"][1]),
          ]);

          this.imgSize = this.originalImageObj.naturalWidth;
          this.tmpCanvas.width = this.imgSize;
          this.tmpCanvas.height = this.imgSize;

          this.distortedImageObj.parentNode.style.width = "100%"
          let inputImageWidth = this.distortedImageObj.parentNode.clientWidth;
          if (inputImageWidth > this.imgSize) {
            inputImageWidth = 2 ** Math.floor(Math.log2(inputImageWidth / this.imgSize)) * this.imgSize;
          } else if (inputImageWidth < this.imgSize) {
            inputImageWidth = this.imgSize / 2 ** Math.ceil(Math.log2(this.imgSize / inputImageWidth));
          }
          this.originalImageObj.style.width = `${inputImageWidth}px`;
          this.distortedImageObj.style.width = `${inputImageWidth}px`;
          this.restoredImageObj.style.width = `${inputImageWidth}px`;
          this.restoredLowerImageObj.style.width = `${inputImageWidth}px`;
          this.dir1ImageObj.style.width = `${inputImageWidth}px`;
          this.dir2ImageObj.style.width = `${inputImageWidth}px`;
          this.dirLower1ImageObj.style.width = `${inputImageWidth}px`;
          this.dirLower2ImageObj.style.width = `${inputImageWidth}px`;

          let backProjImageWidth = this.backProjImageObj.parentNode.clientWidth;
          if (backProjImageWidth > this.imgSize) {
            backProjImageWidth = Math.floor(backProjImageWidth / this.imgSize) * this.imgSize;
          } else {
            backProjImageWidth = this.imgSize / Math.ceil(this.imgSize / backProjImageWidth);
          }
          this.backProjImageObj.style.width = `${backProjImageWidth}px`;

          this.center = img2Array(this.restoredImageObj, this.tmpContext);
          let centerLower = img2Array(this.restoredLowerImageObj, this.tmpContext);
          this.dir1 = img2Array(this.dir1ImageObj, this.tmpContext);
          let dir1Lower = img2Array(this.dirLower1ImageObj, this.tmpContext);
          this.dir2 = img2Array(this.dir2ImageObj, this.tmpContext);
          let dir2Lower = img2Array(this.dirLower2ImageObj, this.tmpContext);

          for (let i = 0; i < this.center.length; i++) {
            if (i % 4 != 3) {
              this.center[i] = this.center[i] + centerLower[i] / 255;
              this.dir1[i] = this.dir1[i] + dir1Lower[i] / 255 - 127;
              this.dir2[i] = this.dir2[i] + dir2Lower[i] / 255 - 127;
            }
          }

          // # Fix direction scale and shift
          let squaredSum = 0;
          for (let i = 0; i < this.dir1.length; i++) { if (i % 4 != 3) { squaredSum += this.dir1[i] ** 2;} }
          let norm = squaredSum ** 0.5 / 255;
          for (let i = 0; i < this.dir1.length; i++) { if (i % 4 != 3) { this.dir1[i] /= norm;} }

          squaredSum = 0;
          for (let i = 0; i < this.dir2.length; i++) { if (i % 4 != 3) { squaredSum += this.dir2[i] ** 2;} }
          norm = squaredSum ** 0.5 / 255;
          for (let i = 0; i < this.dir2.length; i++) { if (i % 4 != 3) { this.dir2[i] /= norm;} }

          let distData = new Float32Array(base64ToArrayBuffer(sampleData["dist"]));
          let zMax = sampleData["zMax"];
          let dist = [];
          let zRange = [];
          for (let i = 0; i < 101; i++) {
            zRange.push((i / 100 * 2 - 1) * zMax);
            dist.push([]);
            for (let j = 0; j < 101; j++) {

            }
          }

            x: [zRange],
            y: [zRange],
            z: [dist],

          Plotly.restyle(this.distPlotly, update, [0]);

              x: [zRange],
              y: [zRange],
              z: [dist],
              contours: {start: sampleData["levels"][i], size: 1., end: sampleData["levels"][i] + 1, coloring: 'lines'},

          }

            xaxis_range: [-zMax, -zMax],
            yaxis_range: [-zMax, -zMax],
          }
          Plotly.relayout(this.distPlotly, update)

          this.update_v();
        };

            Plotly.restyle(this.distPlotly, {x: [[this.v1]], y: [[this.v2]]}, [1])
            let backProj = new Float32Array(this.dir2.length);
            for (let i = 0; i < this.center.length; i++) {
              if (i % 4 != 3) {
                backProj[i] = this.center[i] + this.dir1[i] * this.v1 + this.dir2[i] * this.v2;
              } else {
                backProj[i] = 255;
              }
            }
            let imgData = new ImageData(new Uint8ClampedArray(backProj), this.imgSize, this.imgSize);
            this.tmpContext.putImageData(imgData, 0, 0);
            this.backProjImageObj.src = this.tmpCanvas.toDataURL();
          }
        };

        function loadSampleData(sampleDiv, filename) {
          return new Promise((resolve, reject) => {
            fetch(filename)
              .then(response => response.json(), reject)
              .then(sampleData => {
                samplesData[filename] = sampleData;
                sampleDiv.innerHTML = "";
                let imgObj = createImgBox(sampleDiv);
                imgObj.onload = () => {imgObj.onclick = () => {viewer.updateData(samplesData[filename])};};
                imgObj.src = "data:image/png;base64, " + sampleData["distorted"];
                resolve();
            }, reject);
          });
        }

        async function worker() {
          let task;
          let sampleDiv;
          let filename;
          while (tasks.length > 0) {
            task = tasks.shift()
            sampleDiv = task[0];
            filename = task[1];
            await loadSampleData(sampleDiv, filename);
          }
        }
        for (let i = 0; i < 4; i++) { worker(); }
